import Link from 'react-router-dom'
import styled from 'styled-components'
import { fonts } from '../../utils/style/variables'
import MainCourseIcon from '../../assets/poisson.png'
import Dessert from '../../assets/dessert.png'
import Chef from '../../assets/chef.png'
import Drinks from '../../assets/jus.png'
import Preps from '../../assets/soupe.png'

const StyledMenuWrapper = styled.div`
display: grid;
grid-template-columns: repeat(auto-fill, minmax(4vw, 1fr)); /* Chaque colonne fait 4vw de large */
gap: 0; /* Pas d'espace entre les cellules */
height: 100vh
    grid-gap: 30px;
    margin: 0 auto;
    width: 50vw;
`
const StyledLink = styled.div`
    background-color: black;
    aspect-ratio: 1/1;
    border-radius: 33px;
    padding: 25px;
    cursor: pointer;
`
const StyledTitle = styled.h1`
    text-align: center;
    margin: 0 auto;
    font-family: ${fonts.header};
    color: white;
    font-size: clamp(30px, 50vw, 55px);
    width: 100%;
`

function HomeIcon() {
    return (
        <StyledMenuWrapper>
            <StyledLink>
                <StyledTitle>MA<br></br>IN</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>SWE<br></br>ETS</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>BAS<br></br>ICS</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>DRI<br></br>NKS</StyledTitle>
            </StyledLink>
        </StyledMenuWrapper>
    )
}

export default HomeIcon
